const ethers = require('ethers')

async function go() {
    const initializer =
        ''

    const initializerBytes = ethers.utils.arrayify(initializer)
    const decodedData = ethers.utils.defaultAbiCoder.decode(
        ['address[]', 'bytes', 'bytes', 'bytes', 'bytes', 'bytes', 'bytes'],
        initializerBytes
    )

    const owners = decodedData[0]
    console.log('Owners:', owners)
}

go()
    .then(() => process.exit(0))
    .catch(error => {
        console.error(error)
        process.exit(1)
    })
